(2, 1, '2019-01-26 17:48:50', '2019-01-26 17:48:50', '<!-- wp:paragraph -->\r\n<p><span style=\"font-weight: 400;\">To provide accessible yet efficient method for data management in a scale of a small city, our project focuses on creating a Smart city application which provides services to modern city services and utilities using a well-defined infrastructure to collect and distribute city data. To achieve such goal, a combination of software and hardware platform is used in our application to employ a network of precisely placed sensor devices. The network of sensors will be connected via network connection to a main server system which monitors and process the data efficiently while allowing various application to request and use the collected information. By using such platform, resource and data distribution can be more efficient and transparent to many city service applications to help optimize various task and improve living quality within the city.</span></p>\r\n<p><span style=\"font-weight: 400;\">To demonstrate the use of our application, waste management system is selected as our key focus to indicate the potential of our system responding to real work applications. To simulate the problem, network of sensors is simulated to be placed within each industrial standard garbage collection bins in the city. Through use of ultrasonic sensors, status of the bin is carefully monitored and recorded by the main server system to provide efficient route for collection pickup.</span></p>\r\n<!-- /wp:paragraph -->', 'Problem Definition', '', 'publish', 'closed', 'open', '', 'problemdefinition', '', '', '2019-02-06 23:00:59', '2019-02-06 23:00:59', '', 0, 'http://192.168.0.13/dumpstersite/?page_id=2', 0, 'page', '', 0),
